import React from 'react';
import './App.css';


const sudoku = [ [0, 0, 3, 0, 2, 0, 6, 0, 0], [9, 0, 0, 3, 0, 5, 0, 0, 1], [0, 0, 1, 8, 0, 6, 4, 0, 0], [0, 0, 8, 1, 0, 2, 9, 0, 0], [7, 0, 0, 0, 0, 0, 0, 0, 8], [0, 0, 6, 7, 0, 8, 2, 0, 0], [0, 0, 2, 6, 0, 9, 5, 0, 0], [8, 0, 0, 2, 0, 3, 0, 0, 9], [0, 0, 5, 0, 1, 0, 3, 0, 0] ];



class RowOfFields extends React.Component{

  render(){

    return(
      <div class="row">

        <div className="field"></div>
        <div className="field"></div>
        <div className="field"></div>

      </div>
    )
  }
}


class RowOfSquares extends React.Component{

  render(){

    return(
      <div className="row">

        <div className="square"> <RowOfFields/> <RowOfFields/> <RowOfFields/> </div>
        <div className="square"> <RowOfFields/> <RowOfFields/> <RowOfFields/> </div>
        <div className="square"> <RowOfFields/> <RowOfFields/> <RowOfFields/> </div>

      </div>
    )
  }
}


class Sudoku extends React.Component{

  render(){

    return(
      <div className="sudoku">

        <RowOfSquares rows = {[sudoku[0], sudoku[1], sudoku[2]]} />
        <RowOfSquares rows = {[sudoku[3], sudoku[4], sudoku[5]]} />
        <RowOfSquares rows = {[sudoku[6], sudoku[7], sudoku[8]]} />

      </div>
    )

  }
}



function App() {
  return (
    <div className="App">

      <Sudoku/>

    </div>
  );
}

export default App;
